CREATE TABLE CLINIQUE (
    numV INT,
    nomV TEXT,
    prenomV TEXT,
    adresseV TEXT,
    telephoneV TEXT,
    specialiteV TEXT,
    numC INT,
    nomC TEXT,
    prenomC TEXT,
    adresseC TEXT,
    telephoneC TEXT,
    numA INT,
    nomA TEXT,
    dateNaissanceA DATE,
    especeA TEXT,
    numS INT,
    dateS DATE,
    diagnosticS TEXT,
    traitementS TEXT,
    PRIMARY KEY (numV, numC, numA, numS)
);
